function initUpdateNavbarOnScroll(){var i=document.querySelector(".persosite");window.addEventListener("scroll",function(){window.scrollY?i.classList.add("persosite-white"):i.classList.remove("persosite-white")})}function initUpdateNavbarLinkOnScroll(){var i=document.querySelectorAll(".persosite-link");window.addEventListener("scroll",function(){window.scrollY?i.forEach(function(i){i.classList.add("persosite-white-link")}):i.forEach(function(i){i.classList.remove("persosite-white-link")})})}initUpdateNavbarOnScroll(),initUpdateNavbarLinkOnScroll();